import React from 'react';
import { Card, Row, Col, Typography } from 'antd';

const { Title } = Typography;

const mockMarketData = [
    { commodity: 'Gold', price: '$1,800', change: '+0.5%' },
    { commodity: 'Silver', price: '$25', change: '+1.2%' },
    { commodity: 'Crude Oil', price: '$75', change: '-0.3%' },
    // Add more mock data as needed
];

const mockNews = [
    { headline: 'Market rallies on positive economic data', date: '2024-08-09' },
    { headline: 'Gold prices surge amid global uncertainties', date: '2024-08-08' },
    { headline: 'Tech stocks rebound after recent slump', date: '2024-08-07' },
    // Add more mock news as needed
];

const News = () => (
    <div>
        <Title level={2}>Market and Commodities Rates</Title>
        <Row gutter={[16, 16]}>
            {mockMarketData.map((item, index) => (
                <Col span={8} key={index}>
                    <Card>
                        <Title level={4}>{item.commodity}</Title>
                        <p>Price: {item.price}</p>
                        <p>Change: {item.change}</p>
                    </Card>
                </Col>
            ))}
        </Row>

        <Title level={2} style={{ marginTop: '40px' }}>Latest News</Title>
        <Row gutter={[16, 16]}>
            {mockNews.map((item, index) => (
                <Col span={24} key={index}>
                    <Card>
                        <Title level={4}>{item.headline}</Title>
                        <p>Date: {item.date}</p>
                    </Card>
                </Col>
            ))}
        </Row>
    </div>
);

export default News;
